import { Box, Image, Text, VStack } from "@chakra-ui/react";

export const CharCard = ({ character }) => {
  return (
    <>
      <Box>
        <VStack
          borderRadius="xl"
          borderColor="red"
          borderWidth="1px"
          padding="2"
          alignItems="center"
          alignContent="center"
        >
          <Image
            src={character.image}
            alt={character.name}
            w="200px"
            h="200px"
          />
          <Text>Nome: {character.name}</Text>
          <Text>Gênero: {character.gender}</Text>
          <Text>Espécie: {character.species}</Text>
        </VStack>
      </Box>
    </>
  );
};
